import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Rapidly Add Items to Cart ---
    const addToCartButtons = await page.locator('.add-to-cart').all();
    const addPromises = addToCartButtons.map(button => button.click({ force: true, noWaitAfter: true }));
    await Promise.all(addPromises);

    // Wait for the cart count to update. The text content includes "Cart".
    await page.waitForFunction(() => {
        const cartElement = document.querySelector('.cart');
        return cartElement && !cartElement.textContent.includes('0');
    }, { timeout: 5000 });

    const cartTextAfterAdd = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open Cart Modal ---
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // --- Rapidly Remove Items from Cart ---
    const removeButtons = await page.locator('.remove-item').all();
    const removePromises = removeButtons.map(button => button.click({ force: true, noWaitAfter: true }));
    await Promise.all(removePromises);

    // Wait for the cart to be empty again.
    await page.waitForFunction(() => {
        const cartElement = document.querySelector('.cart');
        return cartElement && cartElement.textContent.includes('0');
    }, { timeout: 5000 });

    const finalCartText = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    return {
      success: true,
      action: "Successfully performed a rapid add and remove cart stress test.",
      extractedData: {
        cartStatusAfterAdding: cartTextAfterAdd.trim(),
        cartStatusAfterRemoving: finalCartText.trim(),
        itemsAdded: addToCartButtons.length,
        itemsRemoved: removeButtons.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
